  `email_alternative` varchar(200) default ' ',
  `contact_number` varchar(100) default ' ',
  `contact_number2` varchar(100) default ' ',
  `permanent_address` varchar(1000) default ' ',
  `pin` int(10) default '0',
  `home_contact_number` varchar(100) default ' ',
  `x_board` varchar(200) default ' ',
  `x_medium` varchar(200) default ' ',
  `x_percentage` varchar(45) default ' ',
  `x_pass_year` varchar(45) default ' ',
  `xii_board` varchar(200) default ' ',
  `xii_medium` varchar(200) default ' ',
  `xii_percentage` varchar(45) default ' ',
  `xii_pass_year` varchar(45) default ' ',
  `gap_in_study` int(2) default '0',
  `gap_reason` varchar(200) default ' ',
  `cpi_6sem` float default '0',
  `backlog` int(4) default '0',
  `spi_1sem` float default '0',
  `spi_2sem` float default '0',
  `spi_3sem` varchar(45) default '0',
  `spi_4sem` float default '0',
  `spi_5sem` float default '0',
  `spi_6sem` float default '0',
